import{_ as e,o as r,c as i,O as a}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 17.1-272 Process and service fees generally.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-272.md","filePath":"vacode/17.1-272.md"}'),o={name:"vacode/17.1-272.md"},t=a('<h1 id="§-17-1-272-process-and-service-fees-generally" tabindex="-1">§ 17.1-272 Process and service fees generally. <a class="header-anchor" href="#§-17-1-272-process-and-service-fees-generally" aria-label="Permalink to &quot;§ 17.1-272 Process and service fees generally.&quot;">​</a></h1><p>A. The fee for process and service in the following instances shall be $12:</p><ol><li><p>Service on any person, firm or corporation, an order, notice, summons or any other civil process, except as herein otherwise provided, and for service on any person, firm, or corporation any process when the body is not taken and making a return thereof, except that no fee shall be charged for service pursuant to § <a href="/vacode/2.2-4022/">2.2-4022</a>.</p></li><li><p>Summoning a witness or garnishee on an attachment.</p></li><li><p>Service on any person of an attachment or other process under which the body is taken and making a return thereon.</p></li><li><p>Service of any order of court not otherwise provided for, except that no fees shall be charged for protective orders issued pursuant to Chapter 11 (§ <a href="/vacode/16.1-226/">16.1-226</a> et seq.) of Title 16.1.</p></li><li><p>Making a return of a writ of fieri facias where no levy is made or forthcoming bond is taken.</p></li><li><p>Summoning a witness in any case in which custody or visitation of a minor child or children is at issue.</p></li></ol><p>B. The fees for process and service in the following instances shall be $25:</p><ol><li><p>Service and publication of any notice of a publicly-advertised public sale.</p></li><li><p>Service of a writ of possession or writ of eviction, except that there shall be an additional fee of $12 for each additional defendant.</p></li><li><p>Levying upon current money, bank notes, goods or chattels of a judgment debtor pursuant to § <a href="/vacode/8.01-478/">8.01-478</a>.</p></li><li><p>Service of a declaration in ejectment on any person, firm or corporation, except that there shall be an additional fee of $12 for each additional defendant.</p></li><li><p>Levying distress warrant or an attachment.</p></li><li><p>Levying an execution.</p></li></ol><p>C. The process and service fee for serving any papers returnable out of state shall be $75, except no fees shall be charged for the service of papers in connection with the prosecution of any misdemeanor or felony domestic violence offense, or in connection with the filing, issuance, registration, or service of a protective order or a petition for a protective order. A victim of domestic violence, stalking, or sexual assault shall not bear the costs associated with the filing of criminal charges against the offender, and no victim shall bear the costs associated with the filing, issuance, registration, or service of a warrant, protective order, petition for a protective order, or witness subpoena, issued inside or outside the Commonwealth.</p><p>D. The fees set out in this section shall be allowable for services provided by such officers in the circuit and district courts.</p><p>Code 1950, §§ 14-104, 14-116, p. 25; 1964, c. 386, §§ 14.1-93, 14.1-105; 1971, Ex. Sess., c. 155; 1972, c. 719; 1975, c. 591; 1976, cc. 308, 310; 1981, c. 411; 1982, c. 674; 1983, c. 407; 1984, c. 317; 1992, c. 648; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0051" target="_blank" rel="noreferrer">51</a>, § 14.1-95.1; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872" target="_blank" rel="noreferrer">872</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0508" target="_blank" rel="noreferrer">508</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0198" target="_blank" rel="noreferrer">198</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0211" target="_blank" rel="noreferrer">211</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0445" target="_blank" rel="noreferrer">445</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0480" target="_blank" rel="noreferrer">480</a>; 2019, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0180" target="_blank" rel="noreferrer">180</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0700" target="_blank" rel="noreferrer">700</a>.</p>',8),n=[t];function s(c,l,f,p,h,d){return r(),i("div",null,n)}const u=e(o,[["render",s]]);export{v as __pageData,u as default};
